import React from 'react';
import PropTypes from 'prop-types';

import '../../styles/ColorScheme.css';
import '../../styles/ElectionBallotReciept.css';

const propTypes = {
    show: PropTypes.boolean
};

const defaultProps = {
    show: false
};

function ElectionBallotRecipt(props) {
    const {
        show
    } = props;

    const modalVisibility = show ? "block" : "none";
    const animation = show ? "animate-in" : "";

    return (
        <div className="election-ballot-reciept-container" style={{ display: modalVisibility }}>
            <div className={`election-ballot-reciept ${animation}`}>

            </div>
        </div>
    );
}

ElectionBallotRecipt.propTypes = propTypes;
ElectionBallotRecipt.defaultProps = defaultProps;
export default ElectionBallotRecipt
